import { CYAN } from './../../helpers/colors';

const EditContact = () => {
  return <>
    <section className="view-contact-intro p3">
      <div className="container">
        <div className="row my-2 text-center">
          <p className="h3 fw-bold" style={{color:CYAN}}>
            اطلاعات مخاطب
          </p>
        </div>
      </div>
    </section>
  </>;
};

export default EditContact;
